import React from 'react'
import { NavLink } from 'react-router-dom'

const roundButton = ({link, icon,}) => {
  return (
    <NavLink className="btn btn-round" to={link} end>
      <span class="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-lt-red">3</span>
      <i className={icon}></i>
    </NavLink>
  )
}

export default roundButton
